'use strict'

import contract from 'truffle-contract'
import { web3 } from '../env'
import eventStoreArtifacts from '../../build/contracts/EventStore.json'

var EventStore = contract(eventStoreArtifacts)
EventStore.setProvider(web3.currentProvider)

import { eventsFromTransaction } from './Transactions'
import { readModelGenerator } from './ReadModel'

import {
    getItem,
    setItem
} from './Persistence'


/**
 * @param {EventStore} es - a contract instance which is an Event Store
 * @param {UInt} eventId - all events after this Id and includig it will be returned
 * @return {Promise<NEW_EVENT, Error>} json object representing a Solidity NEW_EVENT
 */
export const readEvent = async (es, eventId) => {
    return {
        Id: eventId,
        Type: await es.getType(eventId),
        Created: (await es.getCreated(eventId)).toNumber(),
        AddressValue: await es.getAddressValue(eventId),
        UIntValue: (await es.getUIntValue(eventId)).toNumber(),
        StringValue: await es.getStringValue(eventId)
    }
}

/**
 * @param {EventStore} es - a contract instance which is an Event Store
 * @param {UInt} eventId - all events after this Id and includig it will be returned
 * @param {Address} fromAddress - the address you wish to deploy these events from
 * @return {Promise<NEW_EVENT[], Error>} json objects representing Solidity NEW_EVENTs
 */
export const readEvents = async (es, eventId = 0) => {
    let currentEvent = await es.eventCount()
    let eventPromises = []
    while (eventId < currentEvent) {
        eventPromises.push(await readEvent(es, eventId))
        eventId++
    }
    return await Promise.all(eventPromises)
}

/**
 * @param {EventStore} es - a contract instance which is an Event Store
 * @param {NEW_EVENT} event - a NEW_EVENT object to be written to the chain
 * @param {Address} fromAddress - the address you wish to deploy these events from
 * @return {Promise<NEW_EVENT, Error>} json object representing the Solidity NEW_EVENT
 */
export const writeEvent = async (es, event, fromAddress) => {
    let tx = await es.emitEvent(event.Type, event.AddressValue, event.UIntValue, event.StringValue, {
        from: fromAddress,
        gas: 2000000
    })
    return eventsFromTransaction(tx)
}

/**
 * @param {EventStore} es - a contract instance which is an Event Store
 * @param {NEW_EVENT} eventArray - an array of NEW_EVENT objects to be written to the chain
 * @param {Address} fromAddress - the address you wish to deploy these events from
 * @return {Promise<NEW_EVENT[], Error>} json objects representing the Solidity NEW_EVENTs which were written to chain
 */
export const writeEvents = async (es, eventArray, fromAddress) => {
    let eventPromises = eventArray
        .map((event) => {
            return es
                .emitEvent(event.Type, event.AddressValue, event.UIntValue, event.StringValue, {
                    from: fromAddress,
                    gas: 2000000
                })
                .then((tx) => {
                    return eventsFromTransaction(tx)
                })
        })
    return await Promise.all(eventPromises)
        .then((newEvents) => {
            return newEvents
        })
}


/**
 * @param {EventStore} es - a contract instance which is an Event Store
 * @param {initialProjectState} readModel - a json object representing the state of a given model
 * @param {projectReducer} reducer - a function which reduces events into a read model state object
 * @return {Promise<ReadModel, Error>} json object representing the state of a ReadModel for an EventStore
 */
export const maybeSyncReadModel = async (es, readModel, reducer) => {
    let eventCount = (await es.eventCount()).toNumber()
    return getItem(readModel.Id)
        .then(async (_readModel) => {
            if (!_readModel) {
                _readModel = readModel
            }
            if (_readModel.EventCount === eventCount) {
                return false
            }
            let events = await readEvents(es, _readModel.EventCount || 0)
            let updatedReadModel = readModelGenerator(_readModel, reducer, events)
            return setItem(updatedReadModel.Id, updatedReadModel)
        })
}

export default {
    EventStore,
    writeEvent,
    writeEvents,
    readEvent,
    readEvents,
    getItem,
    setItem,
    readModelGenerator,
    maybeSyncReadModel
}

export const NEW_EVENT = 'NEW_EVENT'


/**
 * @typedef {Object} EVENT_SCHEMAS
 * @property {NEW_EVENT} a Solidity Event Schema
 */
export const EVENT_SCHEMAS = {
    [NEW_EVENT]: {
        Id: 'BigNumber',
        Type: 'String',
        Created: 'BigNumber',

        AddressValue: 'String',
        UIntValue: 'BigNumber',
        StringValue: 'String'
    }
}

import { web3 } from '../env'

const event = {
    Id: 0,
    Type: 'PROJECT_CREATED',
    AddressValue: web3.eth.accounts[0],
    UIntValue: 1,
    StringValue: 'Coral'
}

export const eventStream = [
    {
        Id: 1,
        Type: 'PROJECT_JOINED',
        AddressValue: web3.eth.accounts[0],
        UIntValue: 1,
        StringValue: 'Engineer Alice'
    },
    {
        Id: 2,
        Type: 'PROJECT_JOINED',
        AddressValue: web3.eth.accounts[1],
        UIntValue: 1,
        StringValue: 'Customer Bob'
    },
    {
        Id: 3,
        Type: 'PROJECT_MILESTONE',
        AddressValue: web3.eth.accounts[0],
        UIntValue: 1,
        StringValue: 'Version 0'
    }
]

export const initialProjectState = {
    Id: '0',
    EventCount: null,
    Name: '',
    Users: [],
    Milestones: []
}

export const expectedProjectState = {
    Id: '0',
    Name: 'Coral',
    Users: ['Engineer Alice', 'Customer Bob'],
    Milestones: ['Version 0']
}

export const projectReducer = (state = initialProjectState, event) => {
    if (event.Type === 'PROJECT_CREATED') {
        state = Object.assign({}, state, {
            Name: event.StringValue
        })
    }
    if (event.Type === 'PROJECT_JOINED') {
        state = Object.assign({}, state, {
            Users: state.Users.concat(event.StringValue)
        })
    }
    if (event.Type === 'PROJECT_MILESTONE') {
        state = Object.assign({}, state, {
            Milestones: state.Milestones.concat(event.StringValue)
        })
    }
    // Important for synching state
    state.EventCount = event.Id
    return state
}

export default {
    event,
    eventStream,

    initialProjectState,
    expectedProjectState,
    projectReducer
}

let store

if (typeof localStorage === 'undefined' || localStorage === null) {
    const LocalStorage = require('node-localstorage').LocalStorage
    store = new LocalStorage('./scratch')
} else {
    store = localStorage
}

/**
 * @param {String} key - a key for a stored object
 * @return {Object} a promise for the object at the given key
 */
export const getItem = (key) => {
    return new Promise((resolve, reject) => {
        let itemAsString = store.getItem(key)
        try {
            resolve(JSON.parse(itemAsString))
        } catch (e) {
            resolve(itemAsString)
        }
    })
}

/**
 * @param {String} key - a key for a stored object
 * @param {String} value - the object to be stored
 * @return {Object} a promise for the object at the given key
 */
export const setItem = (key, value) => {
    return new Promise((resolve, reject) => {
        store.setItem(key, JSON.stringify(value))
        resolve(value)
    })
}

import {
    getItem,
    setItem
} from './LocalStorage'

export default {
    getItem,
    setItem
}

/**
 * @param {EventStore} readModel - a json object representing the state of a given model
 * @param {projectReducer} reducer - a function which reduces events into a read model state object
 * @param {NEW_EVENT[]} events - events from an es contract
 */
export const readModelGenerator = (readModel, reducer, events) => {
    events.forEach((event) => {
        readModel = reducer(readModel, event)
    })
    return readModel
}

'use strict'

import { web3 } from '../env'
import { assert } from 'chai'

import {
  EventStore,
  writeEvent,
  writeEvents,
  readEvent,
  readEvents,
  getItem,
  setItem,
  readModelGenerator,
  maybeSyncReadModel
} from './EventStore'

import {
  event,
  eventStream,
  initialProjectState,
  expectedProjectState,
  projectReducer
} from './EventStore.mock'

let es, startEventCount, maybeUpdatedReadModel

describe('EventStore', () => {

  before(async () => {
    // console.log(TF)
    es = await EventStore.deployed()
    startEventCount = (await es.eventCount()).toNumber()

  })

  describe('.writeEvent', () => {
    it('should return the event at the index', async () => {
      let events = await writeEvent(es, event, web3.eth.accounts[0])
      assert.equal(events.length, 1)
      assert.equal(events[0].Type, event.Type)
      assert.equal(events[0].AddressValue, event.AddressValue)
      assert.equal(events[0].UIntValue, event.UIntValue)
      assert.equal(events[0].StringValue, event.StringValue)
    })
  })

  describe('.readEvent', () => {
    it('should return the event at the index', async () => {
      let event = await readEvent(es, 0)
      assert.equal(event.Type, event.Type)
      assert.equal(event.AddressValue, event.AddressValue)
      assert.equal(event.UIntValue, event.UIntValue)
      assert.equal(event.StringValue, event.StringValue)
    })
  })

  describe('.writeEvents', () => {
    it('should return the events written to the event store', async () => {
      let events = await writeEvents(es, eventStream, web3.eth.accounts[0])
      assert.equal(events.length, 3)
      // console.log(events)
    })
  })

  describe('.readEvents', () => {
    it('should return the events in the contract starting with the index', async () => {
      let events = await readEvents(es, startEventCount)
      assert.equal(events.length, 4)
      // console.log(events)
    })
  })

  describe('.setItem', () => {
    it('should return the value when passed a valid key, after saving the value', async () => {
      setItem(initialProjectState.Id, initialProjectState)
        .then((readModel) => {
          assert.equal(initialProjectState.Id, readModel.Id)
          assert.equal(initialProjectState.Name, readModel.Name)
        })
    })
  })

  describe('.getItem', () => {
    it('should return null for invalid key', async () => {
      getItem('not-a-real-key')
        .then((readModel) => {
          assert.isNull(readModel)
        })
    })

    it('should return a readModel when passed valid readModelKey', async () => {
      getItem(initialProjectState.Id)
        .then((readModel) => {
          assert.equal(initialProjectState.Id, readModel.Id)
          assert.equal(initialProjectState.Name, readModel.Name)
        })
    })
  })

  describe('.readModelGenerator', () => {
    it('should return the the initial reducer state when no events exist', async () => {
      let projectModel = readModelGenerator(initialProjectState, projectReducer, [])
      assert.equal(projectModel.Id, initialProjectState.Id)
      assert.equal(projectModel.EventCount, initialProjectState.EventCount)
      assert.equal(projectModel.Users, initialProjectState.Users)
      assert.equal(projectModel.Milestones, initialProjectState.Milestones)
    })

    it('should return the updated read model when passed events', async () => {
      let projectHistory = await readEvents(es, startEventCount)
      let projectModel = readModelGenerator(initialProjectState, projectReducer, projectHistory)
      assert.equal(projectModel.Id, expectedProjectState.Id)
      assert.equal(projectModel.Name, expectedProjectState.Name)
      assert.isArray(projectModel.Users, expectedProjectState.Users)
      assert.isArray(projectModel.Milestones, expectedProjectState.Milestones)
    })
  })

  describe('maybeSyncReadModel', () => {
    it('should retrieve a read model and sync any missing events from the contract', async () => {
      let _maybeUpdatedReadModel = await maybeSyncReadModel(es, initialProjectState, projectReducer)
      maybeUpdatedReadModel = _maybeUpdatedReadModel
    })

    it('should return quickly if no new events exist', async () => {
      let sameReadModel = await maybeSyncReadModel(es, maybeUpdatedReadModel, projectReducer)
      assert.equal(sameReadModel.Name, maybeUpdatedReadModel.Name)
      assert.equal(sameReadModel.EventCount, maybeUpdatedReadModel.EventCount)
    })
  })

})

import { forIn, extend } from 'lodash'

const { EVENT_SCHEMAS } = require('../EventTypes')

export const LOG = {}
export const TX = {}

/**
 * @param {String} propType - the type of the truffle property
 * @param {ReadModel} readModel - a json object representing the state of a given model
 * @return {Object} the property type without truffle data types (no bid numbers or other truffle types...)
 */
export const getPropFromSchema = (propType, value) => {
    switch (propType) {
        case 'String': return value.toString()
        case 'BigNumber': return value.toNumber()
        default: throw Error(`UNKNWON propType for value '${value}'. Make sure your schema is up to date.`)
    }
}

/**
 * @param {LOG} log - an ethereum log from a transaction
 * @return {NEW_EVENT} a json object representing a solidity NEW_EVENT
 */
export const eventFromLog = (log) => {
    let schema = EVENT_SCHEMAS[log.event]
    let event = {}
    forIn(log.args, (value, key) => {
        let prop = getPropFromSchema(schema[key], value)
        extend(event, {
            [key]: prop
        })
    })
    return event
}

/**
 * @param {TX} tx - an ethereum log from a transaction
 * @return {NEW_EVENT} an array of all NEW_EVENTS in the transaction tx
 */
export const eventsFromTransaction = (tx) => {
    return tx.logs.map((log) => {
        return eventFromLog(log)
    })
}

